import HomePage from "./page/Home";
import {Routes, Route} from "react-router-dom";
import Header from "./components/header";
import ContentPage from "./page/Content";
import Movie from "./page/Movie";
import PopularMovie from "./page/PopularMovie";
import MovieDetail from "./components/movie/MovieDetail";
import Home from "./page/Home";
import {useEffect, useState} from "react";
function App({data}) {
  const [upcomingState, setUpcoming] = useState([]);
  useEffect(() => {
    fetch(
      "https://api.themoviedb.org/3/movie/upcoming?api_key=131f3dc4657440aa2ed80c0a22a7d1f9&language=en-US&page=1"
    )
      .then((res) => res.json())
      .then((res) => {
        setUpcoming(res);
      }, console.log("Vo duoc day roi "))
      .catch((err) => {
        console.log("Loi day ne ", err);
      });
  }, []);
  data = upcomingState.results;
  console.log("Data App :", data);

  return (
    <div>
      <Routes>
        <Route exact path="/" element={<Home />} />
        <Route path="/content" element={<ContentPage />} />
        <Route path="/movie" element={<Movie />} />
        <Route path="/movie/:id" element={<MovieDetail data={data} />} />
        <Route path="/popular" element={<PopularMovie />} />
      </Routes>
    </div>
  );
}
export default App;
